<body class="newCourse">	<img id="logo" src="images/logo-app.png" alt="logo-app" width="255" height="50">	<div id="container">				<a id="back" href="?controller=courses">Back</a>		<a id="logout" href="?controller=logout">Logout</a>				<form name="newCourse" action="?controller=courses&action=newaction" method="post" enctype="multipart/form-data">			<div class="left">			<p>Course Name: </p>			<input id="courseName" type="text" value="" name="courseName" />			            <p id="error"></p>			</div>            <div class="left">				<p>Start Date: </p>				<input id="datepicker" type="text" value="" name="startDate" />             </div>                        <div class="last">				<p>End Date: </p>				<input id="endpicker" type="text" value="" name="endDate" />             </div>			<h1> Course Assignments </h1>									<ul id="list">				<li class="mainButton">					<input type=text name="prof" placeholder="Assignment name" value="Professionalism" disabled />					<input type=text name="prof_weight" placeholder="Assignment Weight" value="10" maxlength="2" disabled/>				</li>			 			</ul>						<div id="new"></div>						<button id="submit" type="submit" value="login" />		</form>	</div>	